script: |
  super -f text -I q1930.spq | sort > q1930.out

inputs:
  - name: q1930.spq
    data: |
      SELECT DISTINCT - + col0 + - col0 FROM tab1 (FORMAT parquet) WHERE + - col2 * + 93 * - col2 - col0 + - col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q1930.out
    data: |
      -102
      -170
      -182
